schemaDefinition: "create or replace view U_DOCUMENT_RECIPIENTS(\n\t\"DocReceipentStatus\"\
  ,\n\t\"DocRecipientSysID\",\n\t\"DocReceipentReceipent\",\n\t\"DocReceipentCompletedDateTime\"\
  ,\n\t\"DocReceipentRecentRecipientsUpdates\",\n\t\"DocReceipentValue\",\n\t\"DocReceipentName\"\
  ,\n\t\"DocReceipentDeclineReason\",\n\t\"DocReceipentType\",\n\t\"DocInternalReceipent\"\
  ,\n\t\"DocSignerType\",\n\t\"DocOrder\",\n\t\"DocFinanceFlag\"\n) as\n -- SEMANTIC\
  \ LAYER BEGINS\n\nSELECT \"DV_U_STATUS\" as \"DocReceipentStatus\",\n       \"U_DOCUMENT\"\
  \ as \"DocRecipientSysID\",\n       \"U_USER_SOURCE_ID\" as \"DocReceipentReceipent\"\
  ,\n       \"U_COMPLETED_DATE_TIME\" as \"DocReceipentCompletedDateTime\",\n    \
  \   \"U_RECENT_RECIPIENTS_UPDATES\" as \"DocReceipentRecentRecipientsUpdates\",\n\
  \       \"DV_U_DOCUMENT\" as \"DocReceipentValue\",\n       \"U_NAME\" as \"DocReceipentName\"\
  ,\n       \"U_DECLINE_REASON\" as \"DocReceipentDeclineReason\",\n       \"DV_U_RECIPIENT_TYPE\"\
  \ as \"DocReceipentType\",\n       \"DV_U_INTERNAL_RECIPIENT\" as \"DocInternalReceipent\"\
  ,\n       \"DV_U_SIGNER_TYPE\" as \"DocSignerType\",\n       \"U_ORDER\" as \"DocOrder\"\
  ,\n       \"U_FINANCE_FLAG\" as \"DocFinanceFlag\"\nFROM \"RDS\".\"SURF\".\"U_DOCUMENT_RECIPIENTS\"\
  ;"
